  const showCartHandler =()=>{
    return <Cart/>
  }
  return (
    <React.Fragment>
      <Header />
      <main>
        <Meals />
        <HeaderCartButton onShowCart={showCartHandler}/>
      </main>
    </React.Fragment>
  );
};

export default App;
